import React from "react";
import styles from "./Header.module.css";
import meals from "./Assets/meals.jpg";

const Header = () => {
  return (
    <React.Fragment>
      <div>
        <header className={styles["header"]}>React Meals</header>
        <div className={styles["main-image"]}>
          <img src={meals} />
        </div>
      </div>
    </React.Fragment>
  );
};
export default Header;
